import './App.css';
import {useEffect, useState} from 'react'
import ethers from 'ethers'

function App() {

  const [temp1, setTemp1] = useState(0)

  useEffect(() => 
  {
    setTimeout(() =>
    {
      setTemp1(temp1 + 1)
    }, 1000)
  })

  return (
    <div className="App">
      <h1> {temp1} </h1>
    </div>
  );
}

export default App;
